Walter Scott's Castle

Arts Documentary hosted by Stuart Kelly, published by BBC broadcasted as part of BBC Secret Knowledge series in 2013 - English narration


Information
------------------------------

Novelist, poet and all-round cultural impresario Sir Walter Scott is renowned for inventing many of the myths of Scotland that still dominate how the country is imagined. His home in the Scottish Borders, Abbotsford House, brilliantly brings to life his romantic views of Scotland. In the run-up to the reopening of Abbotsford House Scott-fan Stuart Kelly gets exclusive behind-the-scenes access as over 13,000 treasures are moved back into the strange and wonderful building. Exploring some newly discovered secret corners Stuart finds out just how controversial the bizarre building and the man who built it remain.

